import image1 from './../../images/react.jpeg';
import image2 from './../../images/react1.jpeg';
import image3 from './../../images/React2.jpeg';
import image4 from './../../images/react-for.png';

const reactCards = [
    {
      type: "react",
      num: 1,
      image: image1,
      class: "React for Beginner",
      description:
        "Ryan Johnson",
      hours: "$25",
    },
    {
      type: "react",
      num: 2,
      image: image2,
      class: "Create an App with Me",
      description:
        "David Katz",
        hours: "$25",
      },
    {
      type: "react",
      num: 3,
      image: image3,
      class: "React.js and Redux",
      description:
        "John Wall",
        hours: "$25",
      },
    {
      type: "react",
      num: 4,
      image: image4,
      class: "React JS - Learn by examples",
      description:
        "Mary Smith",
        hours: "$25",
      },
  ];

  export default reactCards;
